import React from 'react';
import './App.css';
import Box from '@material-ui/core/Box';

function App() {
  return (
    <div className="App">
      <div style={{ width: '100%' }}>
        <Box display="flex" p={1} bgColor="background.paper">
          {"I'm a flexbox container!"}
        </Box>
       </div>
   </div>
  );
}

export default App;
